let currWord = "";
let currRow = 0;
let guesses = [];
const LETTERS = "abcdefghijklmnopqrstuvwxyz";
const WORDS = "".match(/.{1,6}/g);
const ALL_WORDS = "".match(/.{1,6}/g);

const YELLOW = "#baab02";
const GREEN = "#00ad2e";
const GREY = "#828583";

const REFERENCE = new Date("02/07/2022");
const DAYS_SINCE_REFERENCE = Math.floor(((new Date()) - REFERENCE)/1000/3600/24);
// const DAYS_SINCE_REFERENCE = 4;
const secret = WORDS[DAYS_SINCE_REFERENCE % WORDS.length];
let shouldListen = true;

const GREENBOX = "";
const YELLOWBOX = "";
const GREYBOX = "";

const TODAY_GUESS_LIST = "6wordle_today";
const FAIL_DELIMITER = "X";
const BACKSPACE = "Backspace";
const ENTER = "Enter";

function type(key) {
  inputLetter(key.key);
}

function inputLetter(key) {
  if (!shouldListen) return;
  const input = key;
  if (LETTERS.includes(input.toLowerCase())) {
    if (currWord.length < 6) {
      currWord += input;
      drawRow(currRow, currWord);
    }
  } else if (input === BACKSPACE) {
    currWord = currWord.slice(0, -1);
    drawRow(currRow, currWord);
  } else if (input === ENTER) {
    const input = currWord;
    if (currWord.length < 6) return;
    if (ALL_WORDS.includes(currWord)) {
      // Valid guess
      inputGuess(currRow, currWord, true);
    } else {
      // Invalid guess
      invalidGuess();
    }
  }
}

function saveGuessForToday(dayIndex, guess) {
  let toWrite;
  const data = window.localStorage.getItem(TODAY_GUESS_LIST);
  if (data === null || data.split(":")[0] != DAYS_SINCE_REFERENCE) {
    // Write new data
    toWrite = DAYS_SINCE_REFERENCE + ":" + guess;
  } else {
    // Add onto existing data
    const guesses = data.split(":")[1].split(",");
    guesses.push(guess);
    toWrite = DAYS_SINCE_REFERENCE + ":" + guesses.join();
  }
  window.localStorage.setItem(TODAY_GUESS_LIST, toWrite);
}

function invalidGuess() {
  const row = document.getElementsByClassName("row")[currRow];
  for (let cell of row.children) {
    cell.animate([
      {borderColor: "red"},
      {borderColor: "white"}
    ], 500);
  }

  const message = document.getElementById("message")
  message.innerText = currWord + " is not in our word list.";
  message.animate([
      {opacity: 1},
      {opacity: 0}
    ], 2000);
}

function loseGame() {
  const answer = document.getElementById("answer");
  answer.innerText = secret;
  answer.style.display = "block";
  drawSummary();
}

function drawSummary() {
  shouldListen = false;
  setTimeout(() => {
    const score = (currRow === 6 ? FAIL_DELIMITER : (currRow))
    saveScores(score);

    const pastScores = readScores();
    const numAttempts = pastScores.length;
    const pastSolves = pastScores.filter(x => x[1] != FAIL_DELIMITER); 
    const numSolves = pastSolves.length;
    const avgSolve = numSolves > 0 ? 
      Math.round(pastSolves.reduce((x,y)=>{return parseInt(x) + parseInt(y[1])}, 0) / numSolves * 100) / 100 
      : ":(";

    document.getElementById("score").innerText += score + "/6";
    document.getElementById("attempts").innerText = numAttempts;
    document.getElementById("solves").innerText = numSolves;
    document.getElementById("avg-solve").innerText = avgSolve;

    const popup = document.getElementById("popup");
    popup.style.visibility = "visible";
    popup.style.opacity = 1;
  }, 1000)
}

function saveScores(scoreToAdd) {
  const data = readScores();
  if (data.filter(x => x[0] == DAYS_SINCE_REFERENCE).length === 0) {
    data.push([DAYS_SINCE_REFERENCE, scoreToAdd]);
  } 
  const toWrite = data.map(x => x.join(":")).join(",");
  window.localStorage.setItem("6wordle_scores", toWrite);
}

function readScores() {
  const data = window.localStorage.getItem("6wordle_scores");
  return data ? data.split(",").map(x => x.split(":")) : [];
}

function closePopup() {
  document.getElementById("popup").style.visibility = "hidden";
}

function copyResults() {
  let str = "6WORDLE ";
  str += DAYS_SINCE_REFERENCE + " ";
  const score = (currRow >= 6 ? FAIL_DELIMITER : (currRow + 1)) + "/6\n";
  str += score;

  for (let arr of guesses) {
    let row = "";
    for (let box of arr) {
      switch (box) {
        case 0:
          row += GREYBOX;
        break;
        case 1: 
          row += YELLOWBOX;
        break;
        case 2:
          row += GREENBOX;
        break;
      }
    }
    str += row + "\n";
  }

  str += "https://6wordle.com\n";

  let type = "text/plain";
  let blob = new Blob([str], { type });
  let data = [new ClipboardItem({ [type]: blob })];

  navigator.clipboard.writeText(str).then(
    () => {
      console.log("success");
    },
    () => {
      console.log("failure");
    }
  );
}

function inputGuess(rowIndex, word, animate) {
  saveGuessForToday(DAYS_SINCE_REFERENCE, word);
  const row = document.getElementsByClassName("row")[rowIndex];
  drawRow(rowIndex, word);
  let secretLeft = secret;
  // remove correct guesses
  let paint = [0, 0, 0, 0, 0, 0];
  for (let i = 0; i < 6; i++) {
    const char = word[i];
    if (secret[i] == char) {
      paint[i] = 2;
      secretLeft = secretLeft.replace(char, "");
      updateKeyInfo(char, 3);
    }
  }

  // remove right letter, wrong placement
  for (let i = 0; i < 6; i++) {
    // do not downgrade correct letters
    if (paint[i] === 2) continue;
    const char = word[i];
    if (secretLeft.includes(char)) {
      paint[i] = 1;
      secretLeft = secretLeft.replace(char, "");
      updateKeyInfo(char, 2);
    } else {
      updateKeyInfo(char, 1);
    }
  }

  guesses.push(paint);

  for (let i = 0; i < 6; i++) {
    const back = row.children[i].children[0];
    switch(paint[i]) {
      case 0:
        back.style.backgroundColor = GREY;
        break;
      case 1:
        back.style.backgroundColor = YELLOW;
        break;
      case 2:
        back.style.backgroundColor = GREEN;
        break;
    }
    if (animate) {
      back.style.transitionDelay = (0.15 * i) + "s";
    } else {
      back.style.transition = "unset";
    }
    back.style.transform = "translate(0)";
  }

  currRow++;
  if (word === secret || currRow === 6) {
    drawSummary();
  } else {
    currWord = "";
  }
}

function drawRow(rowIndex, word) {
  let row = document.getElementsByClassName("row")[rowIndex];
  for (let i = 0; i < 6; i++) {
    if (i < word.length) {
      row.children[i].children[1].innerText = word[i];  
    } else {
      row.children[i].children[1].innerText = "";
    }
  }
}

function clickKey(event) {
  const key = event.path[0];
  if (key.tagName === "BUTTON") {
    let value = key.dataset.key;
    if (value === "-") {
      value = BACKSPACE;
    } else if (value === "+") {
      value = ENTER
    }
    inputLetter(value);
  }
}

function updateKeyInfo(char, new_info) {
  if (!char) return;
  const key = document.getElementById(char);
  const info = Math.max(new_info, parseInt(key.dataset.info));
  key.setAttribute("data-info", info);
  switch (info) {
    case 0:
      return;
    case 1: 
      key.style.backgroundColor = GREY;
      return;
    case 2: 
      key.style.backgroundColor = YELLOW;
      return;
    case 3: 
      key.style.backgroundColor = GREEN;
      return;
  }
}

function tryToLoadForToday() {
  const data = window.localStorage.getItem(TODAY_GUESS_LIST);
  window.localStorage.setItem(TODAY_GUESS_LIST,"");
  if (data === null || data.split(":")[0] != DAYS_SINCE_REFERENCE) {
    return;
  }
  const wordsToDraw = data.split(":")[1].split(",");
  if (wordsToDraw.length > 6) {
    return;
  }
  for (let i = 0; i < wordsToDraw.length; i++) {
    inputGuess(i, wordsToDraw[i], false);
    currRow = i + 1;
  }
}

function drawKeyboard() {
  const keyboard = document.getElementById("keyboard");
  const keysLayout = [
    'qwertyuiop-',
    'asdfghjkl+',
    'zxcvbnm'
  ];

  keyboard.addEventListener("click",clickKey);

  for (let i = 0; i < keysLayout.length; i++) {
    const row = keyboard.children[i];
    for (let char of keysLayout[i]) {
      const button = document.createElement("button");
      button.classList.add("key");
      button.id = char;
      if (char == '-') {
        button.innerText = "\u27F5";
      } else if (char == '+') {
        button.innerText = "\u21B5";
      } else {
        button.innerText = char;
      }
      button.setAttribute("data-key",char);
      button.setAttribute("data-info", 0);
      row.appendChild(button);
    }
  }
}

document.addEventListener('keydown', type);
drawKeyboard();
tryToLoadForToday();